import Api from "../../services/api";
import React, { Component,setState } from 'react';


export default class Home extends Component {

    state = {};

     componentDidMount(){
        const config = {
            headers:{
                Authorization:localStorage.getItem('token')
    
        }
        
    }
    Api.get('showProfile',config).then(
        res =>{
            this.setState({
                userDoctor:res.data
            })
        },
        err =>{
            console.log(">>>>>erro home>>>>>>>>>>>",err);
        }
    )
    
    };
    
    render() {

        
        if(this.state.userDoctor){
            return(
                <div>
                <div><a href="/home"><img src="https://i.imgur.com/tDvwyyA.png" className = {'logo'} title="Smart Palm"/></a></div>
                <br></br>
                <br></br>
                <br></br>
                <br></br>
                <br></br>
                <br></br>
                <form className={'form'}>
                <text>Start your login</text>
                  <br></br>
                  <br></br>
                  <br></br>
                  <label>
                    E-mail:
                    <input type="text" name="Email" onChange={e => setEmail(e.target.value)} />
                  </label>
                  <label>
                    Password:
                    <input type="password" name="password" 
                      onChange={e => setPassword(e.target.value)}/>
                  </label>
                  <br></br>
                  <Button buttonSize='btn--large' onClick={handleSubmit}>Sign in</Button>
                  <br></br>
                  <br></br>
                  <a href = "/forgot" className={"label1"}>I forget the password</a>
                  <a href ="/register" className={"label2"}>Sign up</a>
                 </form>
                
              </div>
            )
        }

        return (
            <h2>you are not logged in</h2>
        )
    }
}
